    "                 input_shape = imageshap, activation = \"relu\") %>% \n",
    "\n",
    "    layer_max_pooling_2d(pool_size = c(2,2)) %>% \n",
    "\n",
    "    layer_conv_2d(filters = 12, kernel_size = c(16,16),  \n",
    "\n",
    "                 input_shape = imageshap, activation = \"relu\") %>% \n",
    "\n",
    "    layer_max_pooling_2d(pool_size = c(2,2)) %>% \n",
    "\n",
    "    layer_conv_2d(filters = 12, kernel_size = c(9,9),  \n",
    "\n",
    "                 input_shape = imageshap, activation = \"relu\") %>% \n",
    "\n",
    "    layer_max_pooling_2d(pool_size = c(2,2)) %>% \n",
    "\n",
    "    layer_flatten() %>% \n",
    "\n",
    "    layer_dense(units = 7, activation = \"softmax\") %>% \n",
    "\n",
